import YouTube from 'react-youtube';

function MainVideo() {
    return (
        <main>
        <div className='main'>
           <video className='main__videoplayer' src={Video} poster={Test} controls></video>
        </div>
        <div>
            <h1>Title</h1>
            <p>Description</p>
            <p>Duration</p>
        </div>
        <div>
            <textarea input='text'/>
        </div>
        </main>    
    )
}

export default MainVideo
